# backend/defaults.py
import base64
import os
import logging
from pathlib import Path

# Initialize logger
logger = logging.getLogger(__name__)

# 1. The Base64 Data (Avatar Poster & Mountains Background)
DEFAULT_POSTER_B64 = """

"""

DEFAULT_BACKGROUND_B64 = """

"""

def setup_default_images(target_dir: Path = Path("images")):
    logger.info(f"Target Directory for Defaults: {target_dir.resolve()}")
    
    # Create directory if it doesn't exist
    if not target_dir.exists():
        try:
            target_dir.mkdir(parents=True, exist_ok=True)
            logger.info("Created 'images' directory.")
        except Exception as e:
            logger.error(f"Error creating directory: {e}")
            return

    # 3. Write Files
    files_to_create = {
        "default_poster.jpg": DEFAULT_POSTER_B64,
        "default_background.jpg": DEFAULT_BACKGROUND_B64
    }

    for filename, b64_data in files_to_create.items():
        file_path = target_dir / filename
        
        # Only write if it doesn't exist (to save startup time)
        if not file_path.exists():
            try:
                # Clean and decode
                if b64_data and len(b64_data) > 10:
                    clean_b64 = b64_data.strip()
                    image_data = base64.b64decode(clean_b64)
                    
                    with open(file_path, "wb") as f:
                        f.write(image_data)
                    logger.info(f" Created default image: {file_path}")
            except Exception as e:
                logger.error(f" Failed to create {filename}: {e}")
        else:
            # logger.debug(f" Default image already exists: {filename}")
            pass

if __name__ == "__main__":
    # Configure basic logging if run directly
    logging.basicConfig(level=logging.INFO)
    setup_default_images()